import React, { useEffect, useState } from 'react';
import './CSS/styles.css'
const Header = () => {
  const [links, setLinks] = useState([]);
  useEffect(() => {
    setLinks([
      {
        "name": 'linkedin',
        'url': "https://www.linkedin.com/in/hdevavan/",
        'icon': ""
      },
      {
        "name": 'github',
        'url': "https://github.com/Devavanshi-Harsh",
        'icon': ""
      },
      {
        "name": 'hackerrank',
        'url': "https://www.hackerrank.com/HarshDevavanshi",
        'icon': ""
      },
    ])
  }, [])
  function redirect(url){
    const newTab= window.open(url,'.blank', 'noopener noreferrer')
    newTab.focus();
  }

  return (
    <div>
      <h1 id='name'>Harsh Devavanshi</h1>
      <ul>
        {
          links.map((item, index) => {
            return (
              <button key={index} onClick={()=>redirect(item.url)}>{item.name}</button>
            )
          })
        }
      </ul>
    </div>
  );
};

export default Header;
